import{_ as t,c as d,k as l,a as e,t as b,Q as k,o as a}from"./chunks/framework.9778f8a9.js";const i=JSON.parse('{"title":"从 Windows 过度到 Mac 必备快捷键对照表","description":"深入学习Typescript的关键特性之 Covariance and contravariance","frontmatter":{"date":"2021/04/02","title":"从 Windows 过度到 Mac 必备快捷键对照表","description":"深入学习Typescript的关键特性之 Covariance and contravariance","tags":["快捷键"]},"headers":[],"relativePath":"essay/2021/keymap-win-mac.md","filePath":"essay/2021/keymap-win-mac.md"}'),n={name:"essay/2021/keymap-win-mac.md"},r={id:"frontmatter-title",tabindex:"-1"},f=l("a",{class:"header-anchor",href:"#frontmatter-title","aria-label":'Permalink to "{{ $frontmatter.title }}"'},"​",-1),s=k('<blockquote><p>摘自：<a href="https://github.com/judasn/IntelliJ-IDEA-Tutorial/blob/master/keymap-win-mac.md" target="_blank" rel="noreferrer">IntelliJ-IDEA-Tutorial/keymap-win-mac.md</a></p></blockquote><h2 id="mac-键盘符号" tabindex="-1">Mac 键盘符号 <a class="header-anchor" href="#mac-键盘符号" aria-label="Permalink to &quot;Mac 键盘符号&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">图标</th><th style="text-align:left;">介绍</th></tr></thead><tbody><tr><td style="text-align:left;">⌘</td><td style="text-align:left;"><kbd>Command</kbd></td></tr><tr><td style="text-align:left;">⇧</td><td style="text-align:left;"><kbd>Shift</kbd></td></tr><tr><td style="text-align:left;">⇪</td><td style="text-align:left;"><kbd>Caps Lock</kbd></td></tr><tr><td style="text-align:left;">⌥</td><td style="text-align:left;"><kbd>Option</kbd> = <kbd>Alt</kbd></td></tr><tr><td style="text-align:left;">⌃</td><td style="text-align:left;"><kbd>Control</kbd></td></tr><tr><td style="text-align:left;">↩</td><td style="text-align:left;"><kbd>Enter</kbd></td></tr><tr><td style="text-align:left;">⌫</td><td style="text-align:left;"><kbd>Delete</kbd></td></tr><tr><td style="text-align:left;">⌦</td><td style="text-align:left;"><kbd>Fn</kbd> + <kbd>Delete</kbd></td></tr><tr><td style="text-align:left;">↑</td><td style="text-align:left;"><kbd>上箭头</kbd></td></tr><tr><td style="text-align:left;">↓</td><td style="text-align:left;"><kbd>下箭头</kbd></td></tr><tr><td style="text-align:left;">←</td><td style="text-align:left;"><kbd>左箭头</kbd></td></tr><tr><td style="text-align:left;">→</td><td style="text-align:left;"><kbd>右箭头</kbd></td></tr><tr><td style="text-align:left;">⇞</td><td style="text-align:left;"><kbd>Fn</kbd> + <kbd>↑</kbd> = <kbd>Page Up</kbd></td></tr><tr><td style="text-align:left;">⇟</td><td style="text-align:left;"><kbd>Fn</kbd> + <kbd>↓</kbd> = <kbd>Page Down</kbd></td></tr><tr><td style="text-align:left;">Home</td><td style="text-align:left;"><kbd>Fn</kbd> + <kbd>←</kbd></td></tr><tr><td style="text-align:left;">End</td><td style="text-align:left;"><kbd>Fn</kbd> + <kbd>→</kbd></td></tr><tr><td style="text-align:left;">⇥</td><td style="text-align:left;"><kbd>Tab</kbd> = <kbd>右制表符</kbd></td></tr><tr><td style="text-align:left;">⇤</td><td style="text-align:left;"><kbd>Shift + Tab</kbd> = <kbd>左制表符</kbd></td></tr><tr><td style="text-align:left;">⎋</td><td style="text-align:left;"><kbd>Esc</kbd> = <kbd>Escape</kbd></td></tr><tr><td style="text-align:left;">⏏</td><td style="text-align:left;"><kbd>电源开关键</kbd></td></tr></tbody></table><h2 id="alt" tabindex="-1">Alt <a class="header-anchor" href="#alt" aria-label="Permalink to &quot;Alt&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Win 快捷键</th><th style="text-align:left;">Mac 快捷键</th><th style="text-align:left;">介绍</th></tr></thead><tbody><tr><td style="text-align:left;"><kbd>Alt</kbd> + <kbd>`</kbd></td><td style="text-align:left;"><kbd>Control</kbd> + <kbd>V</kbd></td><td style="text-align:left;">显示版本控制常用操作菜单弹出层</td></tr><tr><td style="text-align:left;"><kbd>Alt</kbd> + <kbd>F1</kbd></td><td style="text-align:left;"><kbd>Option</kbd> + <kbd>F1</kbd></td><td style="text-align:left;">显示当前文件选择目标弹出层，弹出层中有很多目标可以进行选择</td></tr><tr><td style="text-align:left;"><kbd>Alt</kbd> + <kbd>F7</kbd></td><td style="text-align:left;"><kbd>Option</kbd> + <kbd>F7</kbd></td><td style="text-align:left;">查询所选对象/变量被引用</td></tr><tr><td style="text-align:left;"><kbd>Alt</kbd> + <kbd>Enter</kbd></td><td style="text-align:left;"><kbd>Option</kbd> + <kbd>Enter</kbd></td><td style="text-align:left;">IntelliJ IDEA 根据光标所在问题，提供快速修复选择，光标放在的位置不同提示的结果也不同</td></tr><tr><td style="text-align:left;"><kbd>Alt</kbd> + <kbd>Insert</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>N</kbd></td><td style="text-align:left;">代码自动生成，如生成对象的 set / get 方法，构造函数，toString() 等</td></tr><tr><td style="text-align:left;"><kbd>Alt</kbd> + <kbd>左方向键</kbd></td><td style="text-align:left;"><kbd>Control</kbd> + <kbd>左方向键</kbd></td><td style="text-align:left;">切换当前已打开的窗口中的子视图，比如 Debug 窗口中有 Output、Debugger 等子视图，用此快捷键就可以在子视图中切换</td></tr><tr><td style="text-align:left;"><kbd>Alt</kbd> + <kbd>右方向键</kbd></td><td style="text-align:left;"><kbd>Control</kbd> + <kbd>右方向键</kbd></td><td style="text-align:left;">切换当前已打开的窗口中的子视图，比如 Debug 窗口中有 Output、Debugger 等子视图，用此快捷键就可以在子视图中切换</td></tr><tr><td style="text-align:left;"><kbd>Alt</kbd> + <kbd>前方向键</kbd></td><td style="text-align:left;"><kbd>Control</kbd> + <kbd>前方向键</kbd></td><td style="text-align:left;">当前光标跳转到当前文件的前一个方法名位置</td></tr><tr><td style="text-align:left;"><kbd>Alt</kbd> + <kbd>后方向键</kbd></td><td style="text-align:left;"><kbd>Control</kbd> + <kbd>后方向键</kbd></td><td style="text-align:left;">当前光标跳转到当前文件的后一个方法名位置</td></tr><tr><td style="text-align:left;"><kbd>Alt</kbd> + <kbd>1,2,3...9</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>1,2,3...9</kbd></td><td style="text-align:left;">显示对应数值的选项卡，其中 1 是 Project 用得最多</td></tr></tbody></table><h2 id="ctrl" tabindex="-1">Ctrl <a class="header-anchor" href="#ctrl" aria-label="Permalink to &quot;Ctrl&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Win 快捷键</th><th style="text-align:left;">Mac 快捷键</th><th style="text-align:left;">介绍</th></tr></thead><tbody><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>F</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>F</kbd></td><td style="text-align:left;">在当前文件进行文本查找</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>R</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>R</kbd></td><td style="text-align:left;">在当前文件进行文本替换</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Z</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Z</kbd></td><td style="text-align:left;">撤销</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>G</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>L</kbd></td><td style="text-align:left;">跳转到指定行数位置</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Y</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Delete</kbd></td><td style="text-align:left;">删除光标所在行 或 删除选中的行</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>D</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>D</kbd></td><td style="text-align:left;">复制光标所在行 或 复制选择内容，并把复制内容插入光标位置下面</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>W</kbd></td><td style="text-align:left;"><kbd>Option</kbd> + <kbd>方向键上</kbd></td><td style="text-align:left;">递进式选择代码块。可选中光标所在的单词或段落，连续按会在原有选中的基础上再扩展选中范围</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>E</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>E</kbd></td><td style="text-align:left;">显示最近打开的文件记录列表</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>N</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>O</kbd></td><td style="text-align:left;">根据输入的 <strong>类名</strong> 查找类文件</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>J</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>J</kbd></td><td style="text-align:left;">插入自定义动态代码模板</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>P</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>P</kbd></td><td style="text-align:left;">方法参数提示显示</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Q</kbd></td><td style="text-align:left;"><kbd>Control</kbd> + <kbd>J</kbd></td><td style="text-align:left;">当前位置变量、方法的 Documentation 内容显示</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>U</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>U</kbd></td><td style="text-align:left;">前往当前光标所在的方法的父类的方法 / 接口定义</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>B</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>B</kbd></td><td style="text-align:left;">进入光标所在的方法/变量的接口或是定义处，等效于 <code>Ctrl + 左键单击</code></td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>/</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>/</kbd></td><td style="text-align:left;">注释光标所在行代码，会根据当前不同文件类型使用不同的注释符号</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>F1</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>F1</kbd></td><td style="text-align:left;">在光标所在的错误代码处显示错误信息</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>F11</kbd></td><td style="text-align:left;"><kbd>Option</kbd> + <kbd>F3</kbd></td><td style="text-align:left;">选中文件 / 文件夹，使用助记符设定 / 取消书签</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>F12</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>F12</kbd></td><td style="text-align:left;">弹出当前文件结构层，可以在弹出的层上直接输入，进行筛选</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Space</kbd></td><td style="text-align:left;"><kbd>Control</kbd> + <kbd>Space</kbd></td><td style="text-align:left;">基础代码补全，默认在 Windows 系统上被输入法占用，需要进行修改，建议修改为 <code>Ctrl + 逗号</code></td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Delete</kbd></td><td style="text-align:left;"><kbd>Option</kbd> + <kbd>Fn</kbd>+ <kbd>Delete</kbd></td><td style="text-align:left;">删除光标后面的单词或是中文句</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>BackSpace</kbd></td><td style="text-align:left;"><kbd>Option</kbd> + <kbd>Delete</kbd></td><td style="text-align:left;">删除光标前面的单词或是中文句</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>1,2,3...9</kbd></td><td style="text-align:left;"><kbd>Control</kbd> + <kbd>1,2,3...9</kbd></td><td style="text-align:left;">定位到对应数值的书签位置</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>加号</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>加号</kbd></td><td style="text-align:left;">展开代码</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>减号</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>减号</kbd></td><td style="text-align:left;">折叠代码</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>左键单击</kbd></td><td style="text-align:left;"><kbd>Control</kbd> + <kbd>左键单击</kbd></td><td style="text-align:left;">在打开的文件标题上，弹出该文件路径</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>左方向键</kbd></td><td style="text-align:left;"><kbd>Option</kbd> + <kbd>左方向键</kbd></td><td style="text-align:left;">光标跳转到当前单词 / 中文句的左侧开头位置</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>右方向键</kbd></td><td style="text-align:left;"><kbd>Option</kbd> + <kbd>右方向键</kbd></td><td style="text-align:left;">光标跳转到当前单词 / 中文句的右侧开头位置</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>前方向键</kbd></td><td style="text-align:left;">预设中没有该快捷键</td><td style="text-align:left;">等效于鼠标滚轮向前效果</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>后方向键</kbd></td><td style="text-align:left;">预设中没有该快捷键</td><td style="text-align:left;">等效于鼠标滚轮向后效果</td></tr></tbody></table><h2 id="shift" tabindex="-1">Shift <a class="header-anchor" href="#shift" aria-label="Permalink to &quot;Shift&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Win 快捷键</th><th style="text-align:left;">Mac 快捷键</th><th style="text-align:left;">介绍</th></tr></thead><tbody><tr><td style="text-align:left;"><kbd>Shift</kbd> + <kbd>F11</kbd></td><td style="text-align:left;"><kbd>Command + F3</kbd></td><td style="text-align:left;">弹出书签显示层</td></tr><tr><td style="text-align:left;"><kbd>Shift</kbd> + <kbd>Tab</kbd></td><td style="text-align:left;"><kbd>Shift + Tab</kbd></td><td style="text-align:left;">取消缩进</td></tr><tr><td style="text-align:left;"><kbd>Shift</kbd> + <kbd>Enter</kbd></td><td style="text-align:left;"><kbd>Shift + Enter</kbd></td><td style="text-align:left;">开始新一行。光标所在行下空出一行，光标定位到新行位置</td></tr><tr><td style="text-align:left;"><kbd>Shift</kbd> + <kbd>左键单击</kbd></td><td style="text-align:left;"><kbd>Shift + 左键单击</kbd></td><td style="text-align:left;">在打开的文件名上按此快捷键，可以关闭当前打开文件</td></tr></tbody></table><h2 id="alt-shift" tabindex="-1">Alt + Shift <a class="header-anchor" href="#alt-shift" aria-label="Permalink to &quot;Alt + Shift&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Win 快捷键</th><th style="text-align:left;">Mac 快捷键</th><th style="text-align:left;">介绍</th></tr></thead><tbody><tr><td style="text-align:left;"><kbd>Alt</kbd> + <kbd>Shift</kbd> + <kbd>N</kbd></td><td style="text-align:left;"><kbd>Option</kbd> + <kbd>Shift</kbd> + <kbd>N</kbd></td><td style="text-align:left;">选择 / 添加 task</td></tr><tr><td style="text-align:left;"><kbd>Alt</kbd> + <kbd>Shift</kbd> + <kbd>左键双击</kbd></td><td style="text-align:left;"><kbd>Option</kbd> + <kbd>Shift</kbd> + <kbd>左键双击</kbd></td><td style="text-align:left;">选择被双击的单词 / 中文句，按住不放，可以同时选择其他单词 / 中文句</td></tr><tr><td style="text-align:left;"><kbd>Alt</kbd> + <kbd>Shift</kbd> + <kbd>前方向键</kbd></td><td style="text-align:left;"><kbd>Option</kbd> + <kbd>Shift</kbd> + <kbd>前方向键</kbd></td><td style="text-align:left;">移动光标所在行向上移动</td></tr><tr><td style="text-align:left;"><kbd>Alt</kbd> + <kbd>Shift</kbd> + <kbd>后方向键</kbd></td><td style="text-align:left;"><kbd>Option</kbd> + <kbd>Shift</kbd> + <kbd>后方向键</kbd></td><td style="text-align:left;">移动光标所在行向下移动</td></tr></tbody></table><h2 id="ctrl-alt" tabindex="-1">Ctrl + Alt <a class="header-anchor" href="#ctrl-alt" aria-label="Permalink to &quot;Ctrl + Alt&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Win 快捷键</th><th style="text-align:left;">Mac 快捷键</th><th style="text-align:left;">介绍</th></tr></thead><tbody><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Alt</kbd> + <kbd>L</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Option</kbd> + <kbd>L</kbd></td><td style="text-align:left;">格式化代码，可以对当前文件和整个包目录使用（有些文件格式化是有特殊要求的，比如 SQL 文件必须设置方言才可被格式化）</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Alt</kbd> + <kbd>O</kbd></td><td style="text-align:left;"><kbd>Control</kbd> + <kbd>Option</kbd> + <kbd>O</kbd></td><td style="text-align:left;">优化导入的类，可以对当前文件和整个包目录使用</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Alt</kbd> + <kbd>T</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Option</kbd> + <kbd>T</kbd></td><td style="text-align:left;">对选中的代码弹出环绕选项弹出层</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Alt</kbd> + <kbd>S</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>逗号</kbd></td><td style="text-align:left;">打开 IntelliJ IDEA 系统设置</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Alt</kbd> + <kbd>Enter</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Option</kbd> + <kbd>Enter</kbd></td><td style="text-align:left;">光标所在行上空出一行，光标定位到新行</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Alt</kbd> + <kbd>左方向键</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Option</kbd> + <kbd>左方向键</kbd></td><td style="text-align:left;">退回到上一个操作的地方</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Alt</kbd> + <kbd>右方向键</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Option</kbd> + <kbd>右方向键</kbd></td><td style="text-align:left;">前进到上一个操作的地方</td></tr></tbody></table><h2 id="ctrl-shift" tabindex="-1">Ctrl + Shift <a class="header-anchor" href="#ctrl-shift" aria-label="Permalink to &quot;Ctrl + Shift&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Win 快捷键</th><th style="text-align:left;">Mac 快捷键</th><th style="text-align:left;">介绍</th></tr></thead><tbody><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>F</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>F</kbd></td><td style="text-align:left;">根据输入内容查找整个项目 或 指定目录内文件</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>R</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>R</kbd></td><td style="text-align:left;">根据输入内容替换对应内容，范围为整个项目 或 指定目录内文件</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>J</kbd></td><td style="text-align:left;"><kbd>Control</kbd> + <kbd>Shift</kbd> + <kbd>J</kbd></td><td style="text-align:left;">自动将下一行合并到当前行末尾</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>Z</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>Z</kbd></td><td style="text-align:left;">取消撤销</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>W</kbd></td><td style="text-align:left;"><kbd>Option</kbd> + <kbd>方向键下</kbd></td><td style="text-align:left;">递进式取消选择代码块。可选中光标所在的单词或段落，连续按会在原有选中的基础上再扩展取消选中范围</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>N</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>O</kbd></td><td style="text-align:left;">通过文件名定位 / 打开文件 / 目录，打开目录需要在输入的内容后面多加一个正斜杠</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>U</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>U</kbd></td><td style="text-align:left;">对选中的代码进行大 / 小写轮流转换</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>T</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>T</kbd></td><td style="text-align:left;">对当前类生成单元测试类，如果已经存在的单元测试类则可以进行选择</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>C</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>C</kbd></td><td style="text-align:left;">复制当前文件磁盘路径到剪贴板</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>B</kbd></td><td style="text-align:left;"><kbd>Control</kbd> + <kbd>Shift</kbd> + <kbd>B</kbd></td><td style="text-align:left;">跳转到类型声明处</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>/</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Option</kbd> + <kbd>/</kbd></td><td style="text-align:left;">代码块注释</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>[</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>[</kbd></td><td style="text-align:left;">选中从光标所在位置到它的顶部中括号位置</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>]</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>]</kbd></td><td style="text-align:left;">选中从光标所在位置到它的底部中括号位置</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>加号</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>加号</kbd></td><td style="text-align:left;">展开所有代码</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>减号</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>减号</kbd></td><td style="text-align:left;">折叠所有代码</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>F7</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>F7</kbd></td><td style="text-align:left;">高亮显示所有该选中文本，按 Esc 高亮消失</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>F12</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>F12</kbd></td><td style="text-align:left;">编辑器最大化</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>Enter</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>Enter</kbd></td><td style="text-align:left;">自动结束代码，行末自动添加分号</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>Backspace</kbd></td><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>Backspace</kbd></td><td style="text-align:left;">退回到上次修改的地方</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>1,2,3...9</kbd></td><td style="text-align:left;"><kbd>Control</kbd> + <kbd>Shift</kbd> + <kbd>1,2,3...9</kbd></td><td style="text-align:left;">快速添加指定数值的书签</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>左键单击</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>左键单击</kbd></td><td style="text-align:left;">把光标放在某个类变量上，按此快捷键可以直接定位到该类中</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>左方向键</kbd></td><td style="text-align:left;"><kbd>Option</kbd> + <kbd>Shift</kbd> + <kbd>左方向键</kbd></td><td style="text-align:left;">在代码文件上，光标跳转到当前单词 / 中文句的左侧开头位置，同时选中该单词 / 中文句</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>右方向键</kbd></td><td style="text-align:left;"><kbd>Option</kbd> + <kbd>Shift</kbd> + <kbd>右方向键</kbd></td><td style="text-align:left;">在代码文件上，光标跳转到当前单词 / 中文句的右侧开头位置，同时选中该单词 / 中文句</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>前方向键</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>前方向键</kbd></td><td style="text-align:left;">光标放在方法名上，将方法移动到上一个方法前面，调整方法排序</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>后方向键</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>后方向键</kbd></td><td style="text-align:left;">光标放在方法名上，将方法移动到下一个方法前面，调整方法排序</td></tr></tbody></table><h2 id="ctrl-shift-alt" tabindex="-1">Ctrl + Shift + Alt <a class="header-anchor" href="#ctrl-shift-alt" aria-label="Permalink to &quot;Ctrl + Shift + Alt&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Win 快捷键</th><th style="text-align:left;">Mac 快捷键</th><th style="text-align:left;">介绍</th></tr></thead><tbody><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>Alt</kbd> + <kbd>V</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>Shift</kbd> + <kbd>Option</kbd> + <kbd>V</kbd></td><td style="text-align:left;">无格式黏贴</td></tr><tr><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Shift</kbd> + <kbd>Alt</kbd> + <kbd>S</kbd></td><td style="text-align:left;"><kbd>Command</kbd> + <kbd>;</kbd></td><td style="text-align:left;">打开当前项目设置</td></tr></tbody></table><h2 id="other" tabindex="-1">Other <a class="header-anchor" href="#other" aria-label="Permalink to &quot;Other&quot;">​</a></h2><table><thead><tr><th style="text-align:left;">Win 快捷键</th><th style="text-align:left;">Mac 快捷键</th><th style="text-align:left;">介绍</th></tr></thead><tbody><tr><td style="text-align:left;"><kbd>F2</kbd></td><td style="text-align:left;"><kbd>F2</kbd></td><td style="text-align:left;">跳转到下一个高亮错误 或 警告位置</td></tr><tr><td style="text-align:left;"><kbd>F4</kbd></td><td style="text-align:left;"><kbd>F4</kbd></td><td style="text-align:left;">编辑源</td></tr><tr><td style="text-align:left;"><kbd>F11</kbd></td><td style="text-align:left;"><kbd>F3</kbd></td><td style="text-align:left;">添加书签</td></tr><tr><td style="text-align:left;"><kbd>F12</kbd></td><td style="text-align:left;"><kbd>F12</kbd></td><td style="text-align:left;">回到前一个工具窗口</td></tr><tr><td style="text-align:left;"><kbd>Tab</kbd></td><td style="text-align:left;"><kbd>Tab</kbd></td><td style="text-align:left;">缩进</td></tr><tr><td style="text-align:left;"><kbd>ESC</kbd></td><td style="text-align:left;"><kbd>ESC</kbd></td><td style="text-align:left;">从工具窗口进入代码文件窗口</td></tr></tbody></table>',19);const y=t(n,[["render",function(t,k,i,n,y,g){return a(),d("div",null,[l("h1",r,[e(b(t.$frontmatter.title)+" ",1),f]),s])}]]);export{i as __pageData,y as default};
